CREATE TABLE parking (	id int NOT NULL,
						address varchar(255) NOT NULL,
						lat decimal(4,10),
						lng decimal(4,10),
						rate decimal(5,2),
						rate_half_hour decimal(5,2),
						carpark_type varchar(255),
						carpark_type_str varchar(255),
						capacity int,
						max_height real,
						payment_methods text,
						payment_options text,
						rate_details text);
